\viewkind4\uc1\pard\lang2057\f0\fs16 This type of policy offers you more flexibility than \cf1\b whole life\b0  \cf0 insurance. You may be able to increase the death benefit, if you pass a medical examination. The amount deposit may be invested on investment funds. The rest not invested may be used to cover the costs. This can be a useful feature depending on the market. However, you would need to keep in mind that if you don't leave enough money not invested on the account the policy might lapse and your life insurance coverage will end. You should check with your agent before deciding not to make order for buying Units because you might not have enough cash value to pay the monthly charges to prevent a policy lapse.\f1\fs20\par
